import React from "react";
import { Outlet } from "react-router-dom";

import "./shop.css";

// import logo from "../images/ourLogo.jpg";
import logo from "../images/logo.png";

const Shop = () => {
  return (
    <div className="shop">
      <div className="outlet">
        <Outlet />
      </div>
      <div className="logo-page">
        <img src={logo} alt="logo" />
        <h1>تجـربــة</h1>
      </div>
    </div>
  );
};

export default Shop;
